INSERT INTO `posts` VALUES ('019642c4-3e00-7032-965d-13dc433f5f29', 'Bỏ sổ hộ khẩu, thủ tục đăng ký khai sinh có gì khác?', '/storage/thumbnails/1746600202_1746527617-8e0867ba39e376-492-9353-3428-5164-width680height453.jpg', 'Khai sinh', 'Thủ tục đăng ký giấy khai sinh hiện nay đã bãi bỏ quy định về xuất trình giấy tờ chứng minh cư trú.', '<h2><strong style=\"font-size: 13px;\">Thủ tục đăng ký giấy khai sinh hiện nay đã bãi bỏ quy định về xuất trình giấy tờ chứng minh cư trú.</strong></h2><p><em style=\"font-size: 13px;\">Gia đình tôi đang ở TP Thủ Đức, TP.HCM. Vợ tôi mới sinh con. Tôi xin hỏi khi đăng ký khai sinh cho con có khác lúc chưa bỏ sổ hộ khẩu giấy hay không? Thủ tục ra sao?</em></p><p><span style=\"font-size: 13px;\"><img src=\"data:image/jpeg;base64,\"></span></p><p><span style=\"font-size: 13px;\">Luật sư&nbsp;</span><strong style=\"font-size: 13px;\">Ngô Minh Trực</strong><span style=\"font-size: 13px;\">, Đoàn Luật sư TP.HCM, trả lời:</span></p><p><span style=\"font-size: 13px;\">Để chứng minh nguồn gốc của một cá nhân thì giấy khai sinh là một trong giấy tờ có giá trị pháp lý cao nhất. Mọi giấy tờ cá nhân khác với nội dung trong giấy khai sinh thì phải điều chỉnh hồ sơ, giấy tờ theo đúng nội dung trong giấy khai sinh.</span></p><p><span style=\"font-size: 13px;\">Việc làm đăng ký khai sinh cho trẻ là rất quan trọng, là cơ sở để sau này khi trẻ lớn lên được cấp CCCD và nhiều loại giấy tờ quan trọng trong cuộc sống. Giấy khai sinh là điều kiện đầu tiên để trẻ được đến trường.</span></p><p><span style=\"font-size: 13px;\">Bạn có thể lựa chọn, đến trực tiếp cơ quan có thẩm quyền hoặc làm thủ tục đăng ký khai sinh online thông qua cổng dịch vụ công quốc gia.</span></p><p><span style=\"font-size: 13px;\">Hiện nay, khi bạn lựa chọn đến cơ quan có thẩm quyền làm giấy khai sinh cho con thì hồ sơ bạn chuẩn bị có thay đổi so với lúc chưa bỏ sổ hộ khẩu giấy.</span></p><p><span style=\"font-size: 13px;\">Trước kia, khi chưa bỏ sổ hộ khẩu giấy thì người đi đăng ký khai sinh phải xuất trình giấy tờ chứng minh nơi cư trú theo quy định tại Điều 9, Nghị định 123/2015: \"Trong giai đoạn chuyển tiếp, người yêu cầu đăng ký hộ tịch phải xuất trình giấy tờ chứng minh nơi cư trú\".</span></p><p><span style=\"font-size: 13px;\">Tuy nhiên, quy định hiện hành đã bãi bỏ yêu cầu về xuất trình giấy tờ chứng minh cư trú (theo khoản 2, Điều 13, Nghị định 104/2022). Vì vậy, bây giờ bạn đi làm giấy khai sinh cho con thì không cần phải xuất trình giấy tờ chứng minh cư trú như đã nêu trên.</span></p><p><strong style=\"font-size: 13px;\">Hồ sơ đăng ký khai sinh</strong></p><p><span style=\"font-size: 13px;\">Theo quy định hiện hành thì hồ sơ khi làm đăng ký khai sinh cho con như sau:</span></p><p><em style=\"font-size: 13px;\">Giấy tờ phải nộp:</em></p><p><span style=\"font-size: 13px;\">- Tờ khai đăng ký khai sinh theo mẫu được ban hành theo Thông tư 04/2020/TT-BTP;</span></p><p><span style=\"font-size: 13px;\">- Giấy chứng sinh. Trường hợp không có giấy chứng sinh thì nộp văn bản của người làm chứng xác nhận về việc sinh; nếu không có người làm chứng thì phải có giấy cam đoan về việc sinh (khoản 2 Điều 16 Luật hộ tịch 2014).</span></p><p><em style=\"font-size: 13px;\">Giấy tờ phải xuất trình:</em></p><p><span style=\"font-size: 13px;\">Hộ chiếu, chứng minh nhân dân, thẻ căn cước công dân hoặc giấy tờ khác có dán ảnh và thông tin cá nhân của người yêu cầu làm giấy khai sinh do cơ quan có thẩm quyền cấp, còn giá trị sử dụng để chứng minh về nhân thân (khoản 1 Điều 2 nghị định 123/2015)</span></p><p><span style=\"font-size: 13px;\">Trường hợp cha, mẹ của trẻ đã đăng ký kết hôn thì phải xuất trình Giấy chứng nhận kết hôn.</span></p><p><span style=\"font-size: 13px;\">Điều 13, Luật Hộ tịch 2014 quy định cha, mẹ; ông hoặc bà hoặc người thân thích khác; cá nhân, tổ chức đang nuôi dưỡng trẻ sẽ làm Giấy khai sinh cho con tại UBND cấp xã nơi cư trú của cha hoặc mẹ.</span></p><p><strong style=\"font-size: 13px;\">Thủ tục đăng ký khai sinh</strong></p><p><span style=\"font-size: 13px;\">Thủ tục đăng ký khai sinh được quy định tại Điều 3, thông tư 04/2020/TT-BTP, cụ thể như sau:</span></p><p><span style=\"font-size: 13px;\">Người tiếp nhận hồ sơ có trách nhiệm kiểm tra toàn bộ hồ sơ; nếu hồ sơ chưa đầy đủ, hoàn thiện thì hướng dẫn ngay để người nộp hồ sơ bổ sung, hoàn thiện theo quy định.</span></p><p><span style=\"font-size: 13px;\">Trường hợp không thể bổ sung, hoàn thiện hồ sơ ngay thì người tiếp nhận phải lập văn bản hướng dẫn, trong đó nêu rõ loại giấy tờ, nội dung cần bổ sung, hoàn thiện, ký, ghi rõ họ, tên của người tiếp nhận.</span></p><p><span style=\"font-size: 13px;\">Người tiếp nhận có trách nhiệm tiếp nhận đúng, đủ hồ sơ đăng ký hộ tịch theo quy định của pháp luật hộ tịch, không được yêu cầu người đăng ký hộ tịch nộp thêm giấy tờ mà pháp luật hộ tịch không quy định phải nộp.</span></p><p><span style=\"font-size: 13px;\">Người yêu cầu đăng ký hộ tịch có thể nộp bản sao được chứng thực từ bản chính hoặc bản sao được cấp từ sổ gốc (sau đây gọi là bản sao) hoặc bản chụp kèm theo bản chính giấy tờ để đối chiếu. Trường hợp người yêu cầu nộp bản chụp kèm theo bản chính giấy tờ thì người tiếp nhận có trách nhiệm kiểm tra, đối chiếu bản chụp với bản chính và ký xác nhận, không được yêu cầu nộp bản sao giấy tờ đó.</span></p><p><span style=\"font-size: 13px;\">Đối với giấy tờ xuất trình khi đăng ký hộ tịch, người tiếp nhận có trách nhiệm kiểm tra, đối chiếu với thông tin trong tờ khai, chụp lại hoặc ghi lại thông tin để lưu trong hồ sơ và trả lại cho người xuất trình, không được yêu cầu nộp bản sao hoặc bản chụp giấy tờ đó.</span></p><p><span style=\"font-size: 13px;\">Khi trả kết quả đăng ký hộ tịch, người trả kết quả có trách nhiệm hướng dẫn người yêu cầu đăng ký hộ tịch kiểm tra nội dung giấy tờ hộ tịch và Sổ hộ tịch.</span></p><p><span style=\"font-size: 13px;\">Nếu người yêu cầu đăng ký hộ tịch thấy nội dung đúng, phù hợp với hồ sơ đăng ký hộ tịch thì ký, ghi rõ họ, tên trong Sổ hộ tịch theo hướng dẫn của người trả kết quả.</span></p><p><strong style=\"font-size: 13px;\">Ngoài ra, bạn có thể chọn hình thức đăng ký khai sinh online như sau:</strong></p><p><span style=\"font-size: 13px;\">Bạn có thể truy cập https://dichvucong.gov.vn và thực hiện theo các bước sau:</span></p><p><span style=\"font-size: 13px;\">Bước 1: Đăng nhập bằng tài khoản tương ứng. Nếu chưa có tài khoản, người dùng có thể đăng ký tài khoản.</span></p><p><span style=\"font-size: 13px;\">Bước 2: Chọn mục Đăng ký khai sinh thông thường (khối xã) trong nộp trực tuyến.</span></p><p><span style=\"font-size: 13px;\">Bước 3: Điền đầy đủ thông tin vào tờ khai đăng ký khai sinh trực tuyến, đính kèm ảnh chụp giấy chứng sinh, CMND/CCCD, hộ chiếu, đăng ký kết hôn của cha, mẹ (nếu có)...</span></p>', 'Ninh', '16/05/2025', '1', '2025-04-17 08:01:19', '2025-05-16 02:16:50');
INSERT INTO `posts` VALUES ('019642db-c3d6-701e-8ea7-35a3b4da1243', 'Hết thời hét giá, nhà đất Hà Nội quay đầu giảm cả trăm triệu đồng/căn', '/storage/thumbnails/1746605033_Het-thoi-het-gia-nha-dat-Ha-Noi-quay-dau-giam-ca-tram-trieu-dong-1-1734587074-722-width740height986.jpg', 'Khai sinh', 'Chỉ trong thời gian ngắn, giá rao bán của nhiều nhà đất Hà Nội đã ghi nhận mức giảm cả trăm triệu đồng, điều này mở ra hy vọng cho những người có nhu cầu an cư khi Tết nguyên đán 2025 đang đến gần.', '<h2><strong style=\"font-size: 16px;\">Chỉ trong thời gian ngắn, giá rao bán của nhiều nhà đất Hà Nội đã ghi nhận mức giảm cả trăm triệu đồng, điều này mở ra hy vọng cho những người có nhu cầu an cư khi Tết nguyên đán 2025 đang đến gần.</strong></h2><p><strong>Giá nhà đất quay đầu giảm cả trăm triệu đồng</strong></p><p>Anh Duy (Nam Định) cho biết hơn 2 tháng qua gia đình đã nhờ nhiều môi giới giới thiệu những căn nhà riêng&nbsp;phù hợp tài chính để ổn định nơi ở trước thềm Tết nguyên đán 2025. Ông bố sinh năm 1983 chia sẻ đầu tháng 12 được môi giới dẫn xem nhiều căn nhà xây 4 tầng trên diện tích đất 30m2 tại Hà Đông, Hà Nội đang rao bán với mức giá từ 3,55 đến 3,7 tỷ đồng. Dù khá ưng với thiết kế xây dựng của chủ đầu tư, tuy nhiên mức giá quá cao khiến gia đình anh chưa thể chốt được giao dịch.</p><h2><span style=\"font-size: 15px;\">Điều khiến anh Duy và vợ khá bất ngờ là mới đây những môi giới dẫn đi xem nhà cho biết nhiều căn anh đã xem thời gian qua đang được chủ đầu tư giảm từ 100 đến 250 triệu đồng/căn. Theo đó, căn nhà 4 tầng xây trên diện tích đất 30m2 trong ngõ rộng hơn 2m hồi đầu tháng 12 từng được rao bán với mức giá 3,65 tỷ đồng đến nay mức giá chào bán giảm xuống chỉ còn 3,45 tỷ đồng. Một&nbsp;căn khác từng được chào giá 3,5 tỷ đồng nay giảm chỉ còn 3,25 tỷ đồng nếu chốt giao dịch trong tuần, tương đương mức giảm từ 200 - 250 triệu đồng/căn chỉ sau 2 tuần.</span></h2><p class=\"ql-align-center\"><img src=\"data:image/jpeg;base64,\"></p><p>Trước mức giảm giá cả trăm triệu đồng chỉ trong thời gian ngắn, anh Duy cho biết cả hai vợ chồng vẫn đang vẫn cân nhắc việc chờ thêm một thời gian nữa chờ giá giảm sâu hơn trước khi quyết định xuống tiền chốt giao dịch.</p><p>Tương tự, chị Nga, một cư dân tại Nghệ An, vừa nhận được thông tin từ môi giới về một căn nhà 5 tầng, xây dựng trên diện tích 35m2, nằm trên mặt đường rộng có thể cho ô tô tránh nhau và thuận lợi cho việc kinh doanh. Căn nhà này được chào bán hồi đầu tháng 12 với giá 6 tỷ đồng, nhưng hiện tại đã giảm xuống còn 5,8 tỷ đồng. Đáng chú ý, một căn nhà khác chỉ giáp mặt đường lớn cũng đã giảm giá từ 5,9 tỷ đồng xuống còn 5,7 tỷ đồng.</p><p>Anh Minh Đức, chủ một văn phòng BĐS tại Hà Đông cho biết, trong những ngày cuối tháng 12/2024 giá nhà đất tại một số khu vực Hà Nội đã có sự điều chỉnh, trong đó xu hướng giảm giá đang ngày càng phổ biến. “Sau thời gian tăng giá mạnh, gần đây, lượng giao dịch nhà đất đã giảm đáng kể do khách ngừng tìm mua. Do không bán được, nhiều chủ nhà buộc phải hạ giá rao bán, dẫn đến giá ở một số khu vực đã có dấu hiệu giảm”.</p><p>Đưa ra lời khuyên cho những người có nhu cầu mua nhà đất để an cư ở thời điểm này, anh Minh Đức cho biết người mua cần tìm hiểu kỹ pháp lý ngôi nhà định mua tránh những tranh chấp xảy ra trong quá trình giao dịch và về ở sau này. Bên cạnh đó, người mua cần tham khảo những giao dịch xung quanh trong thời gian gần đây để đàm phán được mức giá tốt nhất. Với những người vay ngân hàng mua nhà, cần xác định khả năng trả nợ để tránh áp lực khi hết thời hạn ưu đãi lãi vay.&nbsp;</p><p><strong>Giá nhà đất Hà Nội khó giảm sâu</strong></p><p>Dù giá rao bán nhà đất đang có dấu hiệu giảm ở một số khu vực, tuy nhiên để thực hiện giấc mơ an cư tại Thủ đô vẫn là vấn đề đau đầu với nhiều gia đình. Theo báo cáo từ chuyên trang Batdongsan, trong tháng 11/2024, giá rao bán căn hộ chung cư tại Hà Nội đạt 61 triệu đồng/m², tăng 58% so với tháng 1/2023. Giá nhà riêng tại Hà Nội cũng tăng mạnh, đạt 197 triệu đồng/m², tương đương những ngôi nhà xây trên lô đất 30m2 hiện có giá trung bình gần 6 tỷ đồng. Đất nền tại Hà Nội ghi nhận giá trung bình 70 triệu đồng/m². Diễn biến này phản ánh rõ rệt sự phát triển hạ tầng mạnh mẽ tại Hà Nội với hàng loạt dự án lớn đi vào hoạt động, như các tuyến metro mới, đường vành đai cùng sự ra mắt của nhiều khu đô thị phía Tây và phía Đông.</p>', 'Ninh', '15/05/2025', '1', '2025-04-17 08:27:01', '2025-05-15 03:12:03');
INSERT INTO `posts` VALUES ('019642f6-6a29-73fd-8020-996e68aa66a3', 'Lòng se điếu \'có thể là giả, làm bằng hóa chất giar', '/storage/thumbnails/1746599929_1746540767-lo-ng-heo-jpg-2001-1923-2175-width680height444.jpg', 'Hỏi đáp dịch vụ', 'Khống chế cháy rừng diện rộng ở Bắc Giang', '<h2><strong>Giám đốc Sở An toàn thực phẩm TP HCM Phạm Khánh Phong Lan cho rằng lòng se điếu rất hiếm gặp, cả nghìn con lợn mới có một, nên sản phẩm rao bán hàng ngày có thể là giả và được làm bằng phụ gia, hóa chất.</strong></h2><p>Trao đổi với VnExpress chiều 6/5, bà Lan nói như trên trong bối cảnh gần đây mạng xã hội và thị trường xuất hiện nhiều thông tin mua bán lòng se điếu (còn gọi phèo hai da), giá hàng triệu đồng mỗi kg. Mạng xã hội cũng lan truyền video ghi lại cảnh chủ quán ăn tại Hà Nội khoe cỗ lòng se điếu dài tới 40 m, nặng 5,8 kg từ lợn cái nặng hơn 100 kg, với nhiều tranh cãi về tính xác thực.</p><p>Lòng se điếu là một đoạn ruột non của lợn, có thành ruột dày và nhiều nếp gấp niêm mạc ruột so với lòng ruột non bình thường.</p><p>\"Việc mua bán sản phẩm này khả năng là hành vi gian lận thương mại để tăng lợi nhuận, sản phẩm rao bán hàng ngày có thể là giả, được xử lý qua nhiều biện pháp khác nhau, có thể sử dụng hóa chất để làm dày lớp niêm mạc ruột\", bà Lan nói.</p><p>Theo người đứng đầu ngành an toàn thực phẩm TP HCM, hiện chưa có thông tin khoa học chính thức nào giải thích cơ chế sinh học tạo nên lòng se điếu. Đến nay, có hai quan điểm chính xoay quanh việc hình thành lòng se điếu. Tần suất phát hiện lòng se điếu ở lợn được chăn nuôi thả nhiều hơn so với lợn nuôi công nghiệp, nhưng thực tế&nbsp;<strong>cả nghìn con mới phát hiện một trường hợp</strong>. \"Có thể với kiểu nuôi chăn thả, lợn ăn những loại thức ăn khác, kể cả đất sỏi nên bộ ruột đột biến dày lên tạo nhiều nếp gấp niêm mạc để thích nghi\", bà nói.</p><p>Quan điểm khác, lòng se điếu có thể xuất hiện khi con lợn mắc bệnh lý đường ruột (nhiễm trùng, nhiễm ký sinh trùng...) làm cho niêm mạc ruột bị bào mòn. Khi hồi phục, cơ thể tái tạo lớp niêm mạc dày hơn với những nếp gấp bất thường.</p><p>\"Với cơ chế hình thành như trên thì việc tìm được lòng se điếu phải nói là rất hiếm\", bà Lan phân tích.</p><p>Sở An toàn thực phẩm TP HCM đang phối hợp truy xuất nguồn gốc, lấy mẫu kiểm nghiệm lòng se điếu, làm rõ có sử dụng phụ gia hay chứa chất độc hại hay không. Đến nay, cơ quan chức năng chỉ tập trung kiểm tra các sản phẩm như thịt, cá, chưa kiểm tra lòng se điếu.</p><p>Mới đây, trên trang cá nhân, đầu bếp Võ Quốc kêu gọi mọi người \"ngừng ngay việc ăn lòng se điếu\", bởi \"lòng thường được cho hóa chất vào làm ra lòng se điếu bán giá gấp 10 lần\" và \"rất hiếm, không có nhiều để bán tràn lan\".</p><p>Còn PGS Nguyễn Duy Thịnh, Viện Công nghệ Sinh học và Thực phẩm, Đại học bách khoa Hà Nội, cho rằng do lòng se điếu khan hiếm, nhiều nơi sử dụng hóa chất để tạo ra sản phẩm giả, tiềm ẩn nhiều rủi ro cho sức khỏe. Một số hóa chất như oxy già, phèn chua thường được dùng để ngâm, làm cho bề mặt ruột trắng, cứng, đều nguy hiểm nếu sử dụng với nồng độ cao hoặc ngâm lâu. Trong đó, formol là chất cấm tuyệt đối trong thực phẩm, thường bị lạm dụng để kéo dài thời gian bảo quản nhờ khả năng diệt vi sinh vật. Nếu tiêu thụ thực phẩm có chứa formol, người dùng có nguy cơ bị đau bụng dữ dội, nôn ói, viêm cấp tính dạ dày, ruột, thậm chí tăng nguy cơ ung thư nếu tiếp xúc lâu dài.</p><h1><br></h1>', 'Ninh', '15/05/2025', '1', '2025-04-17 08:56:07', '2025-05-15 11:07:44');
INSERT INTO `posts` VALUES ('019642f8-fbad-70c9-8a25-7572013fcf81', 'Quan chức Mỹ - Trung Quốc chuẩn bị họp \"phá băng\" tại Geneva', '/storage/thumbnails/1746600134_1746540767-lo-ng-heo-jpg-2001-1923-2175-width680height444.jpg', 'Hỏi đáp dịch vụ', 'Ngày 10/5, quan chức Mỹ và Trung Quốc sẽ họp tại Geneva, Thụy Sĩ, nhằm giảm căng thẳng thương mại giữa hai nước, trong bối cảnh thuế quan leo thang làm rung chuyển kinh tế toàn cầu.', '<h2><strong>Ngày 10/5, quan chức Mỹ và Trung Quốc sẽ họp tại Geneva, Thụy Sĩ, nhằm giảm căng thẳng thương mại giữa hai nước, trong bối cảnh thuế quan leo thang làm rung chuyển kinh tế toàn cầu.</strong></h2><p>Ngày 6/5, Reuters đưa tin Bộ trưởng Tài chính Mỹ Scott Bessent và nhà đàm phán thương mại Jamieson Greer sẽ gặp quan chức&nbsp;<a href=\"https://www.24h.com.vn/kinh-doanh-c161.html\" target=\"_blank\" style=\"color: rgb(0, 0, 238);\">kinh tế</a>&nbsp;cấp cao Trung Quốc tại Geneva, Thụy Sĩ vào thứ Bảy (10/5), nhằm tìm cách tháo gỡ căng thẳng thương mại đang gây xáo trộn nền kinh tế toàn cầu.</p><p><strong>Bước đi giảm căng thẳng</strong></p><p>Thông tin về cuộc họp được công bố tối 6/5 (giờ Mỹ) đã khiến hợp đồng tương lai chỉ số S&amp;P 500 tăng khoảng 1%, trong bối cảnh Phố Wall vừa trải qua hai ngày thua lỗ do bất ổn từ chính sách thuế quan của Tổng thống Mỹ Donald Trump.</p><p>Theo Văn phòng Đại diện Thương mại Mỹ và Bộ Tài chính, hai ông Bessent và Greer sẽ đến Geneva vào thứ Năm (8/5) để gặp Tổng thống Thụy Sĩ Karin Keller-Sutter, thảo luận về đàm phán thương mại song phương, trước khi gặp đại diện Trung Quốc.</p><p>Trả lời trên chương trình \"The Ingraham Angle\" của Fox News, ông Bessent nhấn mạnh: \"Cuộc họp này hướng tới giảm căng thẳng. Chúng ta cần hạ nhiệt trước khi tiến xa hơn.\" Phía Mỹ không tiết lộ danh tính quan chức Trung Quốc tham dự, chỉ cho biết đây là \"đại diện hàng đầu về kinh tế\" của Bắc Kinh.</p><p><strong>Phản ứng từ Trung Quốc</strong></p><p>Phó Thủ tướng Trung Quốc Hà Lập Phong, người được xem là nhân vật chủ chốt trong chính sách kinh tế và thương mại của nước này, có thể là đại diện tham dự. Bộ Thương mại Trung Quốc xác nhận đồng ý tái khởi động đối thoại với Mỹ, dựa trên \"lợi ích quốc gia và kỳ vọng của ngành công nghiệp, người tiêu dùng Mỹ\".</p><p>Tuyên bố của Trung Quốc nhấn mạnh: \"Có câu ngạn ngữ cổ: Lắng nghe lời nói, quan sát hành động. Nếu Mỹ nói một đằng, làm một nẻo hoặc dùng đàm phán để che đậy hành vi cưỡng ép, Trung Quốc sẽ không chấp nhận.\"</p><p><strong>Bối cảnh căng thẳng thương mại</strong></p><p>Cuộc họp diễn ra trong bối cảnh Mỹ và Trung Quốc đang mắc kẹt trong vòng xoáy thuế quan. Từ ngày 2/4, ông Trump công bố áp thuế 10% với hầu hết các quốc gia, thuế 25% với ô tô, thép, nhôm, Canada và Mexico, cùng mức thuế 145% với Trung Quốc. Các mức thuế này sẽ có hiệu lực từ ngày 9/7 nếu không đạt thỏa thuận thương mại riêng.</p><p>Trung Quốc đáp trả bằng thuế 125% lên hàng hóa Mỹ, dù có một số miễn trừ. Liên minh châu Âu (EU) cũng cảnh báo sẽ áp biện pháp đối phó nếu không đạt thỏa thuận với Mỹ.</p><p>Chính sách thuế quan của ông Trump nhằm giảm thâm hụt thương mại, nhưng dữ liệu từ Bộ Thương mại Mỹ ngày 6/5 cho thấy thâm hụt thương mại tháng 3/2025 đạt mức kỷ lục do&nbsp;<a href=\"https://www.24h.com.vn/doanh-nghiep-c849.html\" target=\"_blank\" style=\"color: rgb(0, 0, 238);\">doanh nghiệp</a>&nbsp;tăng nhập khẩu trước khi thuế có hiệu lực. Điều này khiến GDP quý I/2025 tăng trưởng âm, lần đầu tiên trong ba năm. Riêng thâm hụt thương mại với Trung Quốc giảm mạnh nhờ thuế cao làm giảm nhập khẩu từ nước này.</p><p><strong>Kỳ vọng từ cuộc họp</strong></p><p>Ông Bessent cho biết chính quyền Tổng thống Trump đang đàm phán với 17 đối tác thương mại và có thể công bố thỏa thuận với một số nước ngay trong tuần này. Trong khi đó, ông Trump tuyên bố sẽ xem xét các thỏa thuận thương mại trong hai tuần tới để quyết định chấp thuận.</p><p>Cuộc gặp tại Geneva không được mô tả là khởi đầu đàm phán chính thức, nhưng được kỳ vọng sẽ mở đường cho đối thoại Mỹ - Trung, vốn đang bị gián đoạn bởi các động thái thuế quan qua lại.</p>', 'Ninh', '07/05/2025', '1', '2025-04-17 08:58:55', '2025-05-07 06:42:14');
INSERT INTO `posts` VALUES ('019680ca-68eb-71b1-8e92-ff7e2f9f88ca', 'Trực tiếp Lễ diễu binh, diễu hành cấp quốc gia kỷ niệm 50 năm Ngày Giải phóng miền Nam, thống nhất đất nước', '/storage/thumbnails/1745922503_Ảnh chụp màn hình 2025-04-29 161502.png', 'Khai sinh', 'Thông báo', '<p>Ngày 30/4, TPHCM sẽ tổ chức Lễ diễu binh, diễu hành cấp quốc gia kỷ niệm 50 năm Ngày Giải phóng miền Nam, thống nhất đất nước (30/4/1975 - 30/4/2025).&nbsp;</p><p>Sau khi đi qua Hội trường Thống Nhất, lực lượng diễu binh, diễu hành chia làm 4 hướng và di chuyển về điểm tập kết.&nbsp;</p>', 'Ninh', '15/05/2025', '1', '2025-04-29 09:04:30', '2025-05-15 03:12:45');
INSERT INTO `posts` VALUES ('019680ce-fdcc-7047-93b5-10484d16a58c', 'Lịch cấm đường ngày 27/4/2025 tổng duyệt diễu binh diễu hành 30/4', '/storage/thumbnails/1745917785_Ảnh chụp màn hình 2025-04-28 154129.png', 'Khai sinh', 'Thông báo', '<p>Để phục vụ cho sơ duyệt, tổng duyệt cấp nhà nước diễu binh, diễu hành và ngày chính thức diễn ra diễu binh, diễu hành trong Lễ kỷ niệm 50 năm Ngày Giải phóng miền Nam, thống nhất đất nước (30/4/1975 -30/4/2025) thì PC08, Công an TPHCM đã thông báo về các khu vực, tuyến đường cấm người và phương tiện lưu thông; cấm dừng đỗ và hạn chế người, phương tiện lưu thông và thời gian thực hiện như sau:</p><p>* Khu vực, tuyến đường:</p><p>- Cầu Ba Son, hướng từ TP. Thủ Đức sang Quận 1 (bắt đầu từ Ngã ba đường D6 + R12).</p><p>- Đường Nguyễn Bỉnh Khiêm (đoạn giáp đường Nguyễn Đình Chiểu đến Nguyễn Hữu Cảnh).</p><p>- Đường Đinh Tiên Hoàng (đoạn giáp đường Nguyễn Đình Chiểu đến Lê Duẩn).</p><p>- Đường Tôn Đức Thắng (đoạn từ đường Lê Duẩn đến điểm quay đầu trước số 37 Tôn Đức Thắng).</p>', 'Ninh', '16/05/2025', '1', '2025-04-29 09:09:31', '2025-05-16 02:44:40');
INSERT INTO `posts` VALUES ('019680d2-5d44-7172-8a81-6214e467cb86', 'Barcelona tan mộng Cúp C1: Phòng ngự như mơ ngủ, Yamal không gánh nổi', '/storage/thumbnails/1746600600_Barcelona-thua-dau-Cup-C1-vi-phong-ngu-nhu-mo-ngu-Yamal-11-1746586166-976-width740height493.jpg', 'AI Hỗ trợ trực tuyến', 'Điểm yếu cố hữu nơi hàng thủ đã trở thành yếu tố then chốt khiến Barcelona gục ngã trong những thời khắc quyết định tại Champions League.', '<p><strong>Tấn công như vũ bão, phòng ngự như mơ ngủ</strong></p><p><span style=\"color: rgb(103, 103, 103); font-size: 14px;\">Barcelona đã khép lại hành trình Champions League đầy tiếc nuối sau thất bại 3-4 trước Inter Milan ở bán kết lượt về, qua đó thua chung cuộc 6-7 sau hai lượt trận. Đoàn quân của HLV Hansi Flick đã khiến người hâm mộ mãn nhãn với lối chơi tấn công rực lửa suốt mùa giải, nhưng chính hàng phòng ngự mong manh mới là yếu tố khiến họ phải trả giá tại đấu trường danh giá nhất châu Âu cấp CLB.</span></p><p>Việc phải nhận 7 bàn thua trước Inter Milan là đỉnh điểm đáng báo động đối với hàng thủ Barcelona. Đội bóng xứ Catalunya đã thủng lưới tới 16 bàn chỉ trong 7 trận gần nhất, con số không thể chấp nhận với một đội bóng đặt mục tiêu vô địch châu Âu.</p><p>Bất chấp phong độ chói sáng của những Lamine Yamal hay Raphinha trên hàng công, đội bóng xứ Catalunya không thể che giấu điểm yếu cố hữu nơi tuyến dưới. Từ tình huống để Marcus Thuram chọc thủng lưới chỉ sau chưa đầy 30 giây ở lượt đi, đến 4 bàn thua ở lượt về, hàng thủ Barcelona liên tục mất tập trung trong những khoảnh khắc then chốt.</p><p>Thậm chí, ở thời điểm mà trận đấu dường như đã nằm trong tay họ, việc không thể kiểm soát nhịp độ và bảo vệ thành quả khiến họ gục ngã. Khoảnh khắc Acerbi đệm bóng gỡ hòa 3-3 ở phút 90+3 giống như “nhát dao” kết liễu giấc mơ lọt vào chung kết Cúp C1 lần thứ 9 của Barcelona, khi sự sụp đổ về tâm lý kéo dài sang cả hiệp phụ và tạo điều kiện để Inter Milan giành chiến thắng quyết định.</p><p><strong>Chuỗi trận thủng lưới đáng báo động</strong></p><p>Cơn ác mộng nơi hàng thủ Barcelona không phải chỉ mới xuất hiện ở trận thua Inter Milan. Chuỗi trận kéo dài từ tứ kết Champions League tới nay đã phơi bày toàn bộ những lỗ hổng hệ thống, điểm yếu cố hữu cuối cùng đã khiến giấc mộng giành “cú ăn ba” của thầy trò HLV Flick tan thành mây khói.</p><p>Tất cả bắt đầu ở trận tứ kết lượt về trên sân Dortmund, khi Barcelona hành quân đến Signal Iduna Park với lợi thế 4-0 từ lượt đi. Tưởng chừng như mọi thứ đã an bài, nhưng thái độ chủ quan khiến họ phải nhận 3 bàn thua, cú sốc lớn đánh dấu khởi đầu cho chuỗi sụp đổ phòng ngự. Dù vẫn giành quyền đi tiếp, những dấu hiệu bất ổn nơi tuyến dưới của Barcelona đã bắt đầu rõ rệt.</p><p>Tại La Liga, những trận thắng đầy chật vật trước Celta Vigo (4-3) và Valladolid (2-1) chỉ càng tô đậm sự mất cân bằng trong lối chơi của Barcelona. Đội bóng xứ Catalunya vẫn ghi bàn đều đặn, nhưng gần như không thể kiểm soát trận đấu mà không thủng lưới. Mallorca là đối thủ&nbsp;duy nhất mà Barcelona (thắng 1-0)&nbsp;giữ sạch lưới trong chuỗi 7 trận gần nhất.</p><p><img src=\"data:image/jpeg;base64,\"></p>', 'Ninh', '07/05/2025', '1', '2025-04-29 09:13:12', '2025-05-07 14:39:14');
INSERT INTO `posts` VALUES ('019680d3-7e04-7383-ac79-0e6030638ecc', 'Barca thua đau Inter sau \"trận cầu điên\", vì sao Yamal vẫn xuất sắc nhất trận?', '/storage/thumbnails/1746600653_Barca-thua-dau-Inter-sau-lamine-yamal-inter---barca-3-copy-1746583416-76-width740height494.jpg', 'Khai sinh', 'Hành trình Champions League 2024/25 của Barcelona đã dừng lại ở bán kết, sau trận thua 3-4 trên sân Giuseppe Meazza. Nhưng ngay cả khi phải dừng bước, thần đồng Lamine Yamal vẫn khiến giới mộ điệu phải trầm trồ.', '<p><strong>Yamal tỏa sáng trong ngày Barca thất bại</strong></p><p><span style=\"color: rgb(103, 103, 103); font-size: 14px;\">Barcelona trải qua trận cầu đầy cảm xúc với&nbsp;</span><a href=\"https://www.24h.com.vn/inter-milan-c48e4453.html\" target=\"_blank\" style=\"color: rgb(0, 0, 238);\">Inter Milan</a>&nbsp;ở bán kết lượt về Champions League. Dẫn trước 3-2 đến tận phút 90+2, những tưởng tấm vé vào chung kết đã nằm trong tay thầy trò HLV Hansi Flick.</p><p>Nhưng đúng vào thời khắc quyết định, Inter gỡ hòa và kéo trận đấu vào hiệp phụ. Tại đây, đại diện Serie A ghi thêm bàn thắng, ấn định chiến thắng 4-3. Chung cuộc, Barca thất bại 6-7 sau hai lượt trận và chính thức khép lại giấc mơ chinh phục châu Âu.</p><p>Dù bị loại, Lamine Yamal vẫn khiến tất cả phải nhắc tên. Ở tuổi 17, sao mai người Tây Ban Nha tiếp tục cho thấy sự trưởng thành vượt bậc trong một trận đấu lớn. Anh có 14 pha rê bóng thành công (nhiều nhất trên sân), đồng thời dẫn đầu với 5 cú sút trúng đích sau 9 lần dứt điểm và 7 lần bị phạm lỗi.</p><p>Một trong số đó suýt nữa đã thành bàn nếu bóng không tìm đến cột dọc ở phút 90+1. Nếu cú sút đó trở thành bàn thắng và Barca nâng tỷ số lên 4-2, mọi thứ chắc chắn sẽ khép lại với Inter.</p><p>Không chỉ kỹ thuật, Yamal còn thể hiện sức mạnh và bản lĩnh khi thắng tới 23 pha tranh chấp tay đôi, một con số quá ấn tượng với một cầu thủ tấn công trẻ tuổi trước hàng phòng ngự giàu kinh nghiệm của Inter. Ngay từ những phút đầu tiên, sao trẻ người Tây Ban Nha này đã tạo ra nhiều cơ hội cho các đồng đội, nhưng lần lượt Ferran Torres, Dani Olmo không tận dụng được.</p><p>Ở hiệp phụ, Yamal có một pha xử lý cực kỳ đẳng cấp khi rê bóng rồi cứa lòng vào góc xa nhưng thủ môn Sommer đã cứu thua bằng những đầu ngón tay. Trước đó vài phút, Lewandowski đánh đầu cận thành lên trời sau một đường kiến tạo như đặt của Yamal.</p><p><strong>Chờ Yamal giải sầu ở Siêu kinh điển</strong></p><p>Với màn trình diễn gần như không có điểm trừ, anh được trang thống kê Whoscored chấm 9,4 điểm, cao hơn bất cứ cầu thủ nào thi đấu ở trận này dù thủ môn Sommer của Inter Milan nhận được danh hiệu Cầu thủ xuất sắc nhất do UEFA bình chọn.</p>', 'Ninh', '07/05/2025', '1', '2025-04-29 09:14:26', '2025-05-07 06:51:10');
INSERT INTO `posts` VALUES ('019680db-f14d-701e-81ac-04c1f8d9debd', 'Chủ tịch tỉnh có thể trực tiếp chỉ đạo cấp xã khi cần thiết', '/storage/thumbnails/1746600734_1746586961--z5483-7113-5439-5484-width680height454.jpg', 'Khai sinh', 'Chính phủ đề xuất bổ sung quy định cho phép UBND và Chủ tịch UBND cấp tỉnh trực tiếp chỉ đạo, điều hành các nhiệm vụ thuộc thẩm quyền của cấp xã trong trường hợp cần thiết.', '<p>Sáng 7/5, Bộ trưởng Bộ Nội vụ Phạm Thị Thanh Trà thừa ủy quyền Thủ tướng trình Quốc hội dự án Luật Tổ chức chính quyền địa phương (sửa đổi). Theo Điều 11 của dự thảo, trong những tình huống cần thiết, chính quyền cấp tỉnh có thể trực tiếp giải quyết các vấn đề thuộc nhiệm vụ, quyền hạn của cơ quan chuyên môn, tổ chức hành chính trực thuộc và cả UBND, Chủ tịch UBND cấp xã.</p><p>Ủy ban Pháp luật và Tư pháp của Quốc hội đồng tình với đề xuất này trong bối cảnh không còn cấp huyện, nhiều chức năng được chuyển giao về cấp xã. Điều này đặt ra thách thức lớn khi năng lực bộ máy cấp xã còn chưa đồng đều, trong khi quy mô và khối lượng công việc gia tăng đáng kể.</p><p>Do đó, việc tăng cường vai trò của chính quyền cấp tỉnh là cần thiết để bảo đảm sự thông suốt trong quản lý, xử lý hiệu quả công việc cho người dân, doanh nghiệp và duy trì hiệu lực hành chính. Chính quyền cấp tỉnh cũng được giao trách nhiệm giám sát, hỗ trợ kịp thời khi chính quyền cấp xã gặp khó khăn trong thực hiện nhiệm vụ.</p><p>Theo Bộ trưởng Phạm Thị Thanh Trà, dự luật quy định theo hướng chính quyền địa phương cấp tỉnh và cấp xã đều tổ chức HĐND và UBND để phù hợp với mô hình chính quyền địa phương hai cấp.</p><p>Cấp tỉnh tập trung ban hành cơ chế, chính sách, chiến lược, quy hoạch, quản lý vĩ mô, các vấn đề có tính chất liên vùng, liên xã, phường. Ngoài ra, cấp tỉnh có trách nhiệm thực hiện nhiệm vụ vượt quá năng lực giải quyết của cấp xã, đòi hỏi chuyên môn sâu và đảm bảo tính thống nhất trên toàn tỉnh.</p><p>Cấp xã là cấp tổ chức thực hiện chính sách (từ trung ương và cấp tỉnh), tập trung vào các nhiệm vụ phục vụ người dân, trực tiếp giải quyết các vấn đề của cộng đồng dân cư, cung cấp các dịch vụ công cơ bản, thiết yếu; các nhiệm vụ cần sự tham gia của cộng đồng, phát huy tính chủ động, sáng tạo của cấp xã.</p><p>Dự thảo Luật cũng bổ sung một số quy định nhằm đẩy mạnh phân quyền từ Trung ương cho chính quyền địa phương cấp tỉnh, nhất là trong việc ban hành các cơ chế, chính sách, các lĩnh vực quy hoạch, tài chính, ngân sách, đầu tư ở địa phương.</p><p>Toàn quốc hiện có 63 tỉnh, thành phố trực thuộc Trung ương và 696 quận, huyện. Trung ương thống nhất số lượng đơn vị hành chính cấp tỉnh sau sáp nhập là 34 tỉnh, thành phố (28 tỉnh và 6 thành phố trực thuộc Trung ương). Dự kiến sau sắp xếp, cả nước giảm từ 10.035 còn hơn 3.320 đơn vị hành chính cấp xã (tương đương 66,91%).</p><p>Dự án Luật này sẽ được thảo luận hội trường vào ngày 14/5 và thông qua trong đợt hai của kỳ họp diễn ra vào tháng 6.</p><p><br></p><p class=\"ql-align-center\"><br></p>', 'Ninh', '15/05/2025', '1', '2025-04-29 09:23:39', '2025-05-15 03:13:19');
INSERT INTO `posts` VALUES ('019680dc-5af9-70d6-8ac0-3833fa8a6378', 'Tổng Bí thư Tô Lâm chỉ đạo thời điểm miễn viện phí toàn dân', '/storage/thumbnails/1746600783_1746587725-tp-164hoinghi3-7097-4015-width645height435.jpg', 'Khai sinh', 'Theo kết luận của Tổng Bí thư, thống nhất thực hiện chủ trương khám sức khoẻ định kỳ cho Nhân dân ít nhất mỗi năm một lần, triển khai trong thời gian sớm nhất. Tổng Bí thư cũng giao Đảng uỷ Chính phủ chỉ đạo nghiên cứu xây dựng Đề án với lộ trình từng bước giảm gánh nặng chi phí y tế cho người dân, tiến tới miễn viện phí toàn dân vào giai đoạn từ 2030 - 2035.', '<h2><strong>Theo kết luận của Tổng Bí thư, thống nhất thực hiện chủ trương khám sức khoẻ định kỳ cho Nhân dân ít nhất mỗi năm một lần, triển khai trong thời gian sớm nhất. Tổng Bí thư cũng giao Đảng uỷ Chính phủ chỉ đạo nghiên cứu xây dựng Đề án với lộ trình từng bước giảm gánh nặng chi phí y tế cho người dân, tiến tới miễn viện phí toàn dân vào giai đoạn từ 2030 - 2035.</strong></h2><p>Văn phòng Trung ương Đảng vừa có thông báo kết luận của Tổng Bí thư Tô Lâm tại buổi làm việc với đại diện Đảng uỷ Chính phủ và các ban, bộ, ngành Trung ương về đánh giá kết quả thực hiện các nghị quyết của Trung ương về công tác chăm sóc sức khoẻ nhân dân và định hướng công tác thời gian tới.</p><p><strong>Tạo đột phá trong công tác chăm sóc sức khoẻ nhân dân</strong></p><p><span style=\"font-size: 17px; color: rgb(41, 41, 41);\">Theo kết luận, trong buổi làm việc ngày 23/4, Tổng Bí thư Tô Lâm kết luận, Đảng và Nhà nước ta luôn quan tâm, dành sự ưu tiên đặc biệt lãnh đạo, chỉ đạo công tác chăm sóc sức khoẻ nhân dân. Mỗi nghị quyết, chỉ thị, kết luận của Ban Chấp hành Trung ương Đảng, Bộ Chính trị, Ban Bí thư ở từng thời kỳ có những mục tiêu, yêu cầu, nhiệm vụ và giải pháp khác nhau, nhưng đều hướng tới mục tiêu cao cả: Nâng cao sức khoẻ thể chất và tinh thần, tầm vóc, tuổi thọ và chất lượng cuộc sống của Nhân dân; xây dựng một hệ thống y tế công bằng, chất lượng, hiệu quả, hội nhập quốc tế; hướng tới bao phủ chăm sóc sức khoẻ toàn dân và bảo đảm khả năng tiếp cận dịch vụ y tế cho mọi người dân.</span></p><p>Trước yêu cầu phát triển đất nước trong kỷ nguyên mới, công tác bảo vệ và chăm sóc sức khoẻ nhân dân vừa là mục tiêu, vừa là động lực để phát triển nhanh và bền vững. Công tác chăm sóc sức khoẻ nhân dân cần hướng đến mục tiêu xây dựng một nước Việt Nam khoẻ mạnh, mọi người dân đều được sống lâu, sống khoẻ, sống lành mạnh, sống hạnh phúc; nguồn nhân lực phải có đủ sức khoẻ về thể chất, tinh thần, trí tuệ và đạo đức để thực hiện mục tiêu đến năm 2030 Việt Nam trở thành nước đang phát triển, có thu nhập trung bình cao, đến năm 2045 trở thành nước phát triển, có thu nhập cao.</p><p>Về những vấn đề chung, Tổng Bí thư đề nghị các cấp ủy, tổ chức đảng phải tiếp tục quán triệt, nhận thức đầy đủ, sâu sắc về vai trò, vị trí đặc biệt quan trọng của công tác bảo vệ, chăm sóc, nâng cao sức khoẻ nhân dân, coi đây là một trong những nhiệm vụ chính trị hàng đầu để phát triển kinh tế - xã hội nhanh và bền vững; đặt sức khoẻ và công tác chăm sóc sức khoẻ lên vị trí chiến lược ưu tiên trong tất cả các chiến lược, chính sách phát triển.</p><p>Tăng cường sự lãnh đạo của các cấp ủy đảng, hiệu quả quản lý của Nhà nước, sự vào cuộc của cả hệ thống chính trị và toàn thể nhân dân trong công tác này, đặc biệt là phát huy vai trò nòng cốt của ngành y tế trong tham mưu, hướng dẫn và tổ chức thực hiện. Xác định rõ trách nhiệm và tăng cường sự phối hợp giữa các cơ quan, tổ chức trong hệ thống chính trị, bảo đảm nguyên tắc một việc phải có người chịu trách nhiệm chính. Ngành y tế chịu trách nhiệm chính về tổng thể công tác bảo vệ, chăm sóc và nâng cao sức khoẻ nhân dân, bảo đảm đạt được mục tiêu các nghị quyết, chỉ thị, kết luận của Đảng đã đề ra.</p>', 'Ninh', '07/05/2025', '1', '2025-04-29 09:24:07', '2025-05-07 06:53:03');
INSERT INTO `posts` VALUES ('019680dd-47ae-70e3-97d0-13fbbe3b6824', 'Mầm non quận 7, TP.HCM rạng ngời cùng cờ Tổ quốc mừng ngày 30.4', null, 'Khai sinh', 'Thông báo1', '<h2>Các bé mầm non quận 7, TP.HCM có hoạt động ý nghĩa mừng 50 năm đất nước thống nhất. Khoảnh khắc nhiều em nhỏ vẫy cờ Tổ quốc, cùng hát vang ca khúc \'Như có Bác Hồ trong ngày vui đại thắng\' khiến nhiều thầy cô xúc động.</h2>', 'Ninh', '07/05/2025', '0', '2025-04-29 09:25:07', '2025-05-07 06:47:59');
