INSERT INTO `posts` VALUES ('0196a97f-9a9f-71bd-bea9-7d7e8c3f1363', 'Inter - Barcelona rượt đuổi tỷ số khó tin, bán kết Cúp C1 mãn nhãn nhất lịch sử (Clip tin nóng)', '/storage/thumbnail/1746600434_98106607-0-image-m-2_1746566672372--1--1746569112-212-width740height495.jpg', 'Khai sinh', '(Clip tin nóng) Có quá nhiều lí do để tin rằng, Inter Milan - Barcelona là trận bán kết kịch tính và mãn nhãn nhất lịch sử Champions League.', '<p>Cũng như trận hòa 3-3 ở bán kết lượt đi Champions League,&nbsp;<a href=\"https://www.24h.com.vn/inter-milan-c48e4453.html\" target=\"_blank\" style=\"color: rgb(0, 0, 238);\">Inter Milan</a>&nbsp;và Barcelona đã cống hiến màn rượt đuổi tỷ số ngoạn mục nữa ở lượt về. Kết quả, đại diện Serie A giành chiến thắng 4-3, qua đó đoạt tấm vé vào chung kết với tồng tỷ số 7-6 sau 2 lượt trận.</p><p>Theo thống kê, đây cũng là trận bán kết có tổng số bàn thắng nhiều nhất lịch sử Champions League (13 bàn), sánh ngang trận Liverpool - AS&nbsp;<a href=\"https://www.24h.com.vn/roma-c48e4452.html\" target=\"_blank\" style=\"color: rgb(0, 0, 238);\">Roma</a>&nbsp;mùa 2017/18. Dù vậy xét về mặt tỷ số lẫn diễn biến ở từng lượt trận, màn thư hùng giữa Inter Milan và Barcelona vượt trội hơn hẳn.</p><p>Ở diễn biến khác,&nbsp;<a href=\"https://www.24h.com.vn/manchester-united-c48e1521.html\" target=\"_blank\" style=\"color: rgb(0, 0, 238);\">MU</a>&nbsp;được cho là đã đưa ra thông điệp cứng rắn về tương lai của đội trưởng Bruno Fernandes trước sự quan tâm từ Al Hilal của Saudi Arabia. Bên cạnh đó, clip tin nóng bóng đá 24h còn mang tới thông tin đáng chú ý liên quan tới tương lai của Trent Alexander Arnold và HLV Carlo Ancelotti. Kính mời độc giả chú ý đón xem!</p>', 'Đinh Mạnh Ninh', '16/05/2025', '1', '2025-05-07 06:47:14', '2025-05-16 02:24:27');
