INSERT INTO `services` VALUES ('0196cce5-04a5-726d-8230-fed93a18da3b', 'TTHN', 'HÔN NHÂN & GIA ĐÌNH', '/storage/icons/1747378517_703213.png', '<p><br></p>', '7', '<p><strong>Mục đích:</strong></p><p>Xác nhận một cá nhân đang độc thân, đã kết hôn, ly hôn hoặc góa, dùng để:</p><ul><li>Đăng ký kết hôn</li><li>Giao dịch tài sản</li><li>Làm thủ tục hành chính, visa, du học…</li></ul><p><strong>Cơ quan thực hiện:</strong></p><p>UBND cấp xã/phường nơi người yêu cầu cư trú.</p><p><strong>Hồ sơ cần có:</strong></p><ul><li>Tờ khai xác nhận tình trạng hôn nhân</li><li>CCCD/CMND</li><li>Sổ hộ khẩu hoặc sổ tạm trú</li><li>Giấy tờ chứng minh tình trạng hôn nhân trước (nếu có)</li></ul><p><strong>Thời gian giải quyết:</strong></p><p>1–3 ngày làm việc.</p><p><strong>Hiệu lực:</strong></p><p>6 tháng kể từ ngày cấp.</p><p><strong>Lệ phí:</strong></p><p>Miễn phí (trừ trường hợp đặc biệt).</p>', '1', null, null, '0', '2025-05-14 03:44:43', '2025-05-16 07:21:47');
